import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { FuelType, BodyType } from './Models/Car';
import axios from 'axios';

const FuelTypeReverseMap: Record<string, number> = {
  Petrol: 0,
  Diesel: 1,
  LPG: 2,
  Hybrid: 3
};

const BodyTypeReverseMap: Record<string, number> = {
  Sedan: 0,
  Hatchback: 1,
  Kombi: 2,
  SUV: 3,
  Roadster: 4
};

export default function CarAdd() {
  const navigate = useNavigate();

  const [car, setCar] = useState({
    brand: "",
    model: "",
    doorsNumber: 0,
    luggageCapacity: 0,
    engineCapacity: 0,
    fuelType: "Petrol",    
    productionDate: "",
    carFuelConsumption: 0,
    bodyType: "Sedan"       
  });

  const handleChange = (
    e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement>
  ) => {
    const { name, value } = e.target;

    setCar(prev => ({
      ...prev,
      [name]:
        ["doorsNumber", "luggageCapacity", "engineCapacity", "carFuelConsumption"].includes(name)
          ? Number(value)
          : value
    }));
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();

    const carToSend = {
      ...car,
      fuelType: FuelTypeReverseMap[car.fuelType],  
      bodyType: BodyTypeReverseMap[car.bodyType]   
    };

    try {
      await axios.post("https://localhost:7135/api/Cars", carToSend);
      navigate("/");
    } catch (err) {
      console.error(err);
      alert("Error adding car");
    }
  };

  return (
    <form
      onSubmit={handleSubmit}
      style={{
        maxWidth: "400px",
        display: "flex",
        flexDirection: "column",
        gap: "15px",
        padding: "20px"
      }}
    >

      <div>
        <label>Brand:</label>
        <input
          type="text"
          name="brand"
          value={car.brand}
          onChange={handleChange}
        />
      </div>

      <div>
        <label>Model:</label>
        <input
          type="text"
          name="model"
          value={car.model}
          onChange={handleChange}
        />
      </div>

      <div>
        <label>Doors:</label>
        <input
          type="number"
          name="doorsNumber"
          value={car.doorsNumber}
          onChange={handleChange}
        />
      </div>

      <div>
        <label>Luggage Capacity:</label>
        <input
          type="number"
          name="luggageCapacity"
          value={car.luggageCapacity}
          onChange={handleChange}
        />
      </div>

      <div>
        <label>Engine Capacity:</label>
        <input
          type="number"
          name="engineCapacity"
          value={car.engineCapacity}
          onChange={handleChange}
        />
      </div>

      {/* FUEL TYPE SELECT */}
      <div>
        <label>Fuel Type:</label>
        <select
          name="fuelType"
          value={car.fuelType}
          onChange={handleChange}
        >
          {Object.keys(FuelType).map(name => (
            <option key={name} value={name}>
              {name}
            </option>
          ))}
        </select>
      </div>

      {/* DATE */}
      <div>
        <label>Production Date:</label>
        <input
          type="date"
          name="productionDate"
          value={car.productionDate}
          onChange={handleChange}
        />
      </div>

      <div>
        <label>Fuel Consumption:</label>
        <input
          type="number"
          name="carFuelConsumption"
          value={car.carFuelConsumption}
          onChange={handleChange}
        />
      </div>

      {/* BODY TYPE SELECT */}
      <div>
        <label>Body Type:</label>
        <select
          name="bodyType"
          value={car.bodyType}
          onChange={handleChange}
        >
          {Object.keys(BodyType).map(name => (
            <option key={name} value={name}>
              {name}
            </option>
          ))}
        </select>
      </div>

      <button type="submit">
        Add
      </button>
    </form>
  );
}
